import React, { useState } from 'react'







const Profile = () => {

  let date = new Date();
  let yr = date.toDateString();
  let tim = date.toLocaleTimeString()

  return (
    <div>
      <div>My name is baby</div>
      <div>Todays Date is {yr}</div>
      <div>Current Time is {tim}</div>
    </div>
  )
}

export default Profile
